import { useEffect, useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import "./App.css";
import Todotable from "./components/Todotable.js";
import Additemform from "./components/Additemform.js";
import NavBar from "./components/NavBar.js";
import { UContext } from "./index.js";

function App() {
  const { setguest, guest } = useContext(UContext);
  const navigate = useNavigate();
  const [currentuser, setcurrentuser] = useState("");
  const [items, setitems] = useState(() => JSON.parse(localStorage.getItem("items")) || []);
  const [completedItems, setCompletedItems] = useState(() => JSON.parse(localStorage.getItem("citems")) || []);
  const [expiredItems, setExpiredItems] = useState(() => JSON.parse(localStorage.getItem("eitems")) || []);
  const [popup, setpopup] = useState(false);
  const [Name, setname] = useState("");
  const [desc, setdesc] = useState("");
  const [time, settime] = useState("");

  useEffect(() => {
    const fetchCurrentUser = async () => {
      try {
        const res = await axios.post("/currentUser");
        setcurrentuser(res.data);
        setguest('false');
      } catch {
        setguest('true');
      }
    };
    fetchCurrentUser();
  }, [setguest]);

  useEffect(() => {
    const checkExpiredItems = () => {
      const now = new Date().getTime();
      items.forEach((item, i) => {
        if (new Date(item.time).getTime() <= now) {
          setExpiredItems(prev => [...prev, item]);
          handledelete(i, 'current-task');
        }
      });
    };
    checkExpiredItems();
  }, [items]);

  useEffect(() => {
    if (guest) {
      localStorage.setItem("items", JSON.stringify(items));
      localStorage.setItem("citems", JSON.stringify(completedItems));
      localStorage.setItem("eitems", JSON.stringify(expiredItems));
    } else {
      const fetchItems = async () => {
        try {
          const expiredRes = await axios.post('/getsetitems', { mode: 'get', itemtype: 'expired' });
          const currentRes = await axios.post('/getsetitems', { mode: 'get', itemtype: 'current' });
          const completedRes = await axios.post('/getsetitems', { mode: 'get', itemtype: 'completed' });

          setExpiredItems(expiredRes.data);
          setitems(currentRes.data);
          setCompletedItems(completedRes.data);
        } catch (error) {
          console.error(error);
        }
      };
      fetchItems();
    }
  }, [guest]);

  const handledone = (index) => {
    const completedItem = { ...items[index], currentdate: new Date().toJSON() };
    setCompletedItems(prev => [...prev, completedItem]);
    setitems(prev => prev.filter((_, i) => i !== index));
  };

  const handledelete = (index, mode) => {
    if (mode === "current-task") {
      setitems(prev => prev.filter((_, i) => i !== index));
    } else if (mode === "expired-task") {
      setExpiredItems(prev => prev.filter((_, i) => i !== index));
    } else if (mode === "completed-task") {
      setCompletedItems(prev => prev.filter((_, i) => i !== index));
    }
  };

  const handleadd = () => {
    setpopup(false);
    const currentdate = new Date().toJSON().slice(0, 19).replace('T', ' ');
    const trimmedDesc = desc.trim() || "No Description";

    if (Name.trim() === "" || time.trim() === "") {
      alert("Please fill in all fields.");
      return;
    }

    const newItem = { Name: Name.trim(), desc: trimmedDesc, time: time.trim(), currentdate };
    setitems(prev => [...prev, newItem]);
    setname("");
    setdesc("");
    settime("");
  };

  return (
    <>
      <div className="header">
        <NavBar setpopup={setpopup} username={currentuser}></NavBar>
      </div>
      <div className="App-header">
        <Todotable mode="current-task" items={items} handleit={handledone} />
        <Todotable mode="completed-task" items={completedItems} handleit={handledelete} />
        <Todotable mode="expired-task" items={expiredItems} handleit={handledelete} />
      </div>
      <Additemform
        popup={popup}
        setpopup={setpopup}
        Name={Name}
        desc={desc}
        time={time}
        setdesc={setdesc}
        setname={setname}
        settime={settime}
        handleadd={handleadd}
      />
    </>
  );
}

export default App;
